import Link from 'next/link';
import Layout from '../components/layout';
import InitialDisplay from '../components/initial-display';

const Index = () => (
    <Layout>
        <div className="row justify-content-center text-center mt-5 mb-5">
            <div className="col ml-md-auto slide-top">
                <style jsx>{`
                    .slide-top {
                        animation-name: fade-top;
                        animation-duration: .8s;
                        animation-timing-function: ease-out;
                        transform-origin: center;
                    }
                    @keyframes fade-in {
                        0% {
                            transform: scale(.95, .95);
                            opacity: 0;
                        }
                        100% {
                            transform: scale(1, 1);
                            opacity: 1;
                        }
                    }
                    @keyframes fade-top {
                        0% {
                            transform: translate(0, -20px);
                            opacity: 0;
                        }
                        100% {
                            transform: translate(0, 0);
                            opacity: 1;
                        }
                    }
                `}</style>
                <h1 className="display-2">Wyvern Realty Group</h1>
                <h2>More choice, less cost</h2>
            </div>
        </div>
        <div className="row">
            <div className="col-md-12 col-l-67">
                <InitialDisplay title={'A Different Real Estate Experience'} body={'Here at Wyvern Real Estate Group we strive to offer you a Real Estate experience like no other. Our unique approach  to handling payment and service allows you to get what you want without paying us a traditional commission, and therefore saving you money!'} />
            </div>
        </div>
    </Layout>
)

export default Index;
